        Header: "MemberID",
        accessor: "memberid",
    },
    {
      Header: "Full Name",
      accessor: "patientname",
    },
    {
        Header: "DOB",
        accessor: "Birthdate",
    },
    {
      Header: "Address",
      accessor: "PatientFullAddress",
